package collection_ex.addmap;

import java.util.LinkedHashMap;

public class LinkedHashmap_ex {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		LinkedHashMap<Integer,String> ls = new LinkedHashMap<>();
		ls.put(1, "rose");
		ls.put(2, "sunflower");
		ls.put(3,"merrygold");
		ls.put(4, null);
		ls.put(null,"lotus");
		ls.put(5, "sunflower");
		ls.put(3,"jasmine");
		
		System.out.println(ls);
		
		
		
		

	}

}
